import React, { useEffect, useState } from 'react'
import { connect } from 'react-redux'

function ButtonActiveted() {
    const [projectActiveted, useprojectActiveted] = useState[null]
    props.projects.forEach(el => {
        props.pageDetail.post.forEach(element => {
            if (element.idPost == el.post.idPost) {
                useprojectActiveted(true)
            } else {
                useprojectActiveted(false)
            }
        })
    })
    useEffect(() => {
        props.getPagePostProject()
    }, [])
    return (
        <div>
            btn
        </div>
    )
}

const mapStateToProps = (state) => {
    return {
        pageDetail: state.selectedPageReducer,
        projects: state.allProjects,
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        getPagePostProject: () => dispatch(getConnectedPagesProject()),
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(ButtonActiveted)
